import React, { useState } from 'react';
import { signupApi } from "../../apis/Api";

const Registerpage = () => {
  // State management
  const [nickname, setNickName] = useState('')
  const [email, setEmail] = useState('')
  const [password, setPassword] = useState('')
  const [retypepassword, setRetypePassword] = useState('')

  // Error states
  const [nicknameError, setNickNameError] = useState('')
  const [emailError, setEmailError] = useState('')
  const [passwordError, setPasswordError] = useState('')
  const [retypepasswordError, setRetypePasswordError] = useState('')

  // Handle input changes
  const handleNickname = (e) => {
    setNickName(e.target.value)
    setNickNameError('')  // Clear error when user types
  }

  const handleEmail = (e) => {
    setEmail(e.target.value)
    setEmailError('')  // Clear error when user types
  }

  const handlePassword = (e) => {
    setPassword(e.target.value)
    setPasswordError('')  // Clear error when user types
  }

  const handleRetypepassword = (e) => {
    setRetypePassword(e.target.value)
    setRetypePasswordError('')  // Clear error when user types
  }

  // Validation
  const validate = () => {
    let isValid = true;

    if (nickname.trim() === '') {
      setNickNameError("Nickname is Required!")
      isValid = false
    }

    if (email.trim() === '') {
      setEmailError("Email is Required!")
      isValid = false
    } else if (!/\S+@\S+\.\S+/.test(email)) {
      setEmailError("Please enter a valid email address")
      isValid = false
    }

    if (password.trim() === '') {
      setPasswordError("Password is Required!")
      isValid = false
    }

    if (retypepassword.trim() === '') {
      setRetypePasswordError("Confirm password is required")
      isValid = false
    }

    if (retypepassword.trim() !== password.trim()) {
      setRetypePasswordError("Password does not match")
      isValid = false
    }

    return isValid;
  }

  // Submit handler
  const handleSubmit = async (e) => {
    e.preventDefault();

    // Validate inputs
    const isValidated = validate();
    if (!isValidated) return;
    
    try {
      const response = await signupApi({ 
        nickname,  // Remove .value as we're using state directly
        email,
        password,
        retypepassword
      });
      
      console.log("Registration successful:", response.data);
      alert("User registered successfully!");
      // Clear form after successful registration
      setNickName('');
      setEmail('');
      setPassword('');
      setRetypePassword('');
    } catch (error) {
      const errorMessage = error.response?.data?.message || "An error occurred during registration.";
      console.error("Registration failed:", errorMessage);
      alert(errorMessage);
    }
  };

  return (
    <div className='container mt-2'>
      <h1>Create an Account!</h1>

      <form className='w-50' onSubmit={handleSubmit}>
        <div className="mb-3">
          <label className="form-label">NickName</label>
          <input 
            type="text" 
            className='form-control' 
            value={nickname}
            onChange={handleNickname} 
            placeholder='Enter your Nickname' 
          />
          {nicknameError && <p className='text-danger'>{nicknameError}</p>}
        </div>

        <div className="mb-3">
          <label className="form-label">Email</label>
          <input 
            type="email" 
            className='form-control' 
            value={email}
            onChange={handleEmail} 
            placeholder='Enter your Email' 
          />
          {emailError && <p className='text-danger'>{emailError}</p>}
        </div>

        <div className="mb-3">
          <label className="form-label">Password</label>
          <input 
            type="password" 
            className='form-control' 
            value={password}
            onChange={handlePassword} 
            placeholder='Enter your Password' 
          />
          {passwordError && <p className='text-danger'>{passwordError}</p>}
        </div>

        <div className="mb-3">
          <label className="form-label">Re-type Password</label>
          <input 
            type="password" 
            className='form-control' 
            value={retypepassword}
            onChange={handleRetypepassword} 
            placeholder='Confirm your password' 
          />
          {retypepasswordError && <p className='text-danger'>{retypepasswordError}</p>}
        </div>

        <button type="submit" className='btn btn-dark w-100'>Create an Account</button>
      </form>
    </div>
  );
}

export default Registerpage;
